    console.log("--- Formatting Final Results ---");
    const formatCurrency = (value)=>{
        return `$${Math.round(value).toLocaleString()}`;
    };
    const batteryInterest = data.batteryInterest;
    let systemTypeString = "Grid-Tied Solar PV System";
